import "./product.css";

const Product = ({ link, platform, courseName}) => {
  // console.log(key);
  return (
    <div className="p">
      <div className="p-browser">
        <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div>
      </div>
      <a href={link} target="_blank" rel="noreferrer">

      </a>

      <p>{courseName}</p>
      <p>{platform}</p>
      <li>{link}</li>
    </div>
  );
};

export default Product;
